.co-resource-item {
  align-items: baseline;
  display: flex;
  min-width: 0; // required so co-break-word works
  @include co-break-word;
  &--inline {
    display: inline-flex;
    margin: 0 20px 0 0;
  }
  &--truncate {
    white-space: nowrap;
    .co-resource-item__resource-name {
      line-height: normal;
      overflow: hidden;
      text-overflow: ellipsis;
    }
  }
  &__deleting {
    animation: co-resource-icon__deleting 1.5s cubic-bezier(0.45, 0.05, 0.55, 0.95) alternate infinite;
    flex: 0 0 auto;
    font-size: ($font-size-base - 1);
    font-weight: var(--pf-global--FontWeight--bold);
    margin: 0 0 0 15px;
    overflow: hidden;
    padding: 0 0 2px;
    position: relative;
    white-space: nowrap;
  }
  &__help-text {
    margin-left: 3px;
    white-space: nowrap;
  }
  &__resource-name {
    min-width: 0; // required so co-break-word works
  }
  &__resource-status {
    padding-left: 8px;
    white-space: nowrap;

    &-badge {
      vertical-align: middle;
      .co-icon-and-text__icon {
        top: 2px;
      }
    }
