",".co-sysevent-icon {
  background-color: #fff;
  border: solid 3px $color-pf-black-200;
  border-radius: 50%;
  color: #fff;
  position: relative;
  z-index: 10;
  height: 18px;
  width: 18px;
}


.co-sysevent--warning {
  .co-sysevent-icon,
  .co-sysevent__box {
    border-color: var(--pf-global--warning-color--100);
  }
  .co-sysevent__icon-line {
    background-color: var(--pf-global--warning-color--100);
  }
}
","$color-dark-border: #ddd;

.co-sysevent-stream {
  padding: 60px 0 50px 0;
  position: relative;
}

.slide-entering {
  left: 100%;
  opacity: 0;
}

.slide-entered {
  left: 0;
  opacity: 1;
  transition: all 0.5s;
}

.co-sysevent-stream__connection-error {
  color: $color-pf-red;
}

.co-sysevent-stream__timeline {
  bottom: 30px;
  position: absolute;
  top: 35px;
}
.co-sysevent-audit__timeline {
  margin-left: 0;
  bottom: 203px;
  position: absolute;
  top: 26px;
}

.co-sysevent-stream__status {
  display: flex;
  justify-content: space-between;
  position: absolute;
  top: 9px;
  left: 40px;
  right: 4px;
  @media (min-width: $screen-sm-min) {
    padding-left: 25px;
    left: 45px;
    right: 0;
  }
}

.co-sysevent-stream__status-box-empty {
  border-style: solid;
  border-color: $color-pf-black-200;
  border-width: 1px 0;
}

.co-sysevent-stream__timeline__end-message {
  bottom: 0;
  position: absolute;
  transform: translateY(50%);
  white-space: nowrap;
  z-index: 1;
  .co-sysevent-stream__timeline--empty & {
    display: none;
  }
}

.co-sysevent-stream__timeline__btn {
  margin: 0;
  transform: translate(0%, -100%);
  margin-left: 2px;
}

.co-sysevent {
  display: flex;
  justify-content: flex-start;
  flex-wrap: wrap;
}

.co-sysevent--transition {
  padding-bottom: 15px;
}

.co-sysevent__box {
  background-color: #fff; // prevent overlapping text if events overlap each other
  border: solid 1px $color-dark-border;
  border-bottom-color: $color-pf-black-200;
  flex: none;
  padding: 10px;
  width: 100%;
}

.co-sysevent__details {
  display: flex;
  justify-content: space-between;
}
.co-sysevent__details__alignRight {
  justify-content: flex-end;
}

.co-sysevent__resourcelink {
  display: block;
  flex: 2 0 0;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}

.co-sysevent__subheader {
  display: flex;
  justify-content: space-between;
  white-space: pre;
  > *:not(:first-child) {
    margin-left: 8px;
  }
}

.co-sysevent__source {
  flex: 1;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}

.co-sysevent__timestamp {
  flex: 1 0 0;
  justify-content: flex-end;
}

.co-sysevent__message {
  @include co-break-word;
  margin-right: -11px; // align with edge if scrollable area is visible (sysevent_box padding + border)
  margin-top: 10px;
  max-height: 150px;
  overflow-y: auto;
  padding-right: 11px;
  position: relative;
}

.co-sysevent__icon-box {
  flex: 0 0 100px;
  display: none;
  position: relative;
  .co-sysevent-icon {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(calc(50% - 17px), calc(-50% + 1px));
  }
}

.co-sysevent__icon-line {
  background-color: $color-pf-black-200;
  height: 3px;
  position: absolute;
  top: 50%;
  left: 50%;
  width: 50%;
}

@media (min-width: $grid-float-breakpoint) {
  .co-sysevent {
    flex-wrap: nowrap;
    margin-left: -40px;
  }

  .co-sysevent__box {
    flex: 1 2 auto;
    border: solid 1px $color-pf-black-200;
    min-width: 0%; // necessary for wrapping since its a flex child
  }

  .co-sysevent__icon-box {
    display: block;
  }

  .co-sysevent-stream {
    padding-top: 50px;
    padding-left: 10px;
  }

  .co-sysevent-stream__timeline {
    border-bottom: 3px solid $color-pf-black-200;
    border-left: 3px solid $color-pf-black-200;
    margin-left: 10px;
    &--empty {
      border: 0;
    }
  }

  .co-sysevent-stream__timeline__btn {
    transform: translate(-50%, -100%);
    margin-left: -2px;
  }
  .co-sysevent-audit {
    padding-top: 10px;
  }

  .co-sysevent-stream__timeline__end-message {
    left: 45px;
  }
}
