",".co-toggle-play.pf-c-button {
  background-color: #fff;
  border: 3px solid $color-pf-black-200;
  border-radius: 50%;
  height: 32px;
  margin-right: 15px;
  padding: 0;
  width: 32px;

  // play icon
  &.co-toggle-play--inactive:before {
